import { NavLink } from "react-router-dom";
import "./landing.css"

export default class index extends Component {
  render() {
    return (
      <div className="page__leader fullsize">
        <div className="container">
          <div className="">
            <NavLink to="/home" className="landing__title">GO HOME</NavLink>
          </div>
        </div>
      </div>
    );
  }
}
